import React, { useState } from "react";

const PokemonMovesTable = ({
  pokemonData,
  currentSelectedPokemon,
  formatText,
}) => {
  const [currentPage, setCurrentPage] = useState(1);
  const movesPerPage = 5;

  const allMoves = pokemonData[currentSelectedPokemon].moves.sort((a, b) => {
    const levelA = a.version_group_details[0]?.level_learned_at || 999; // Use 999 as a default value
    const levelB = b.version_group_details[0]?.level_learned_at || 999; // Use 999 as a default value
    return levelA - levelB;
  });

  const indexOfLastMove = currentPage * movesPerPage;
  const indexOfFirstMove = indexOfLastMove - movesPerPage;
  const currentMoves = allMoves.slice(indexOfFirstMove, indexOfLastMove);

  const totalPages = Math.ceil(allMoves.length / movesPerPage);

  const handlePageChange = (newPage) => {
    setCurrentPage(newPage);
  };

  const renderDots = () => {
    if (totalPages <= 5) return null; // Don't render dots if there are fewer than or equal to 5 pages
    if (currentPage <= 3) {
      // Render dots only after page 3
      return <span className="mx-2">...</span>;
    }
    if (currentPage >= totalPages - 2) {
      // Render dots only before the last 2 pages
      return <span className="mx-2">...</span>;
    }
    return (
      <>
        <span className="mx-2">...</span>
        <button
          onClick={() => handlePageChange(currentPage + 1)}
          className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
        >
          {currentPage + 1}
        </button>
      </>
    );
  };

  return (
    <div className="w-full border rounded">
      <table className="w-full">
        <thead>
          <tr>
            <th className="px-4 py-2">Move Name</th>
            <th className="px-4 py-2">Level Learned At</th>
            <th className="px-4 py-2">Learn Method</th>
          </tr>
        </thead>
        <tbody>
          {currentMoves.map((move, index) => (
            <tr key={index}>
              <td className="border px-4 py-2">
                <p className="font-bold">Name: </p>
                <p className="">{formatText(move.move.name)}</p>
              </td>
              <td className="border px-4 py-2">
                <p className="font-bold">Lvl. Learned: </p>
                {move.version_group_details[0]?.level_learned_at || "N/A"}
              </td>
              <td className="border px-4 py-2">
                <p className="font-bold">Obtained By: </p>
                {move.version_group_details[0].move_learn_method.name ===
                "machine"
                  ? "TM"
                  : formatText(
                      move.version_group_details[0]?.move_learned_method.name ||
                        "N/A"
                    )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="flex justify-center mt-4">
        {currentPage > 1 && (
          <button
            onClick={() => handlePageChange(currentPage - 1)}
            className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
          >
            {currentPage - 1}
          </button>
        )}
        <button
          onClick={() => handlePageChange(1)}
          className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
        >
          1
        </button>
        {currentPage > 3 && <span className="mx-2">...</span>}
        {currentPage === totalPages && (
          <button
            onClick={() => handlePageChange(currentPage - 2)}
            className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
          >
            {currentPage - 2}
          </button>
        )}
        {currentPage === totalPages - 1 && (
          <button
            onClick={() => handlePageChange(currentPage - 1)}
            className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
          >
            {currentPage - 1}
          </button>
        )}
        <button
          className={`mx-2 bg-blue-500 text-white px-4 py-2 rounded-full`}
        >
          {currentPage}
        </button>
        {currentPage === 1 && totalPages > 3 && (
          <button
            onClick={() => handlePageChange(currentPage + 1)}
            className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
          >
            {currentPage + 1}
          </button>
        )}
        {currentPage === 2 && totalPages > 3 && (
          <button
            onClick={() => handlePageChange(currentPage + 2)}
            className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
          >
            {currentPage + 2}
          </button>
        )}
        {currentPage < totalPages - 2 && <span className="mx-2">...</span>}
        {currentPage === totalPages - 2 && (
          <button
            onClick={() => handlePageChange(currentPage + 1)}
            className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
          >
            {currentPage + 1}
          </button>
        )}
        <button
          onClick={() => handlePageChange(totalPages)}
          className={`mx-2 bg-gray-300 px-4 py-2 rounded-full`}
        >
          {totalPages}
        </button>
        {renderDots()}
      </div>
    </div>
  );
};

export default PokemonMovesTable;
